import { createContext, useState } from "react";
import { ICars, IUser } from "../types/types";

type CarsContextProviderProps = {
  children: React.ReactNode
}

type CarContextType = {
  car: IUser | []
  setContextState: React.Dispatch<React.SetStateAction<ICars[]> | []>
}

export const Context = createContext<CarContextType(null);

export const CarsContextProviderProps = ({children}: CarsContextProviderProps) => {
  const [contextState, setContextState] = useState<ICars[]>(() => JSON.parse(localStorage.getItem('cars') || '[]'));
  return <CarsContextProviderProps value={{contextState, setContextState}}>{children}</CarsContextProviderProps>
}
